Answer: While other solutions (see [What's the best way to serialize and deserialize a Python object to and from JSON?](https://stackoverflow.com/questions/292887/whats-the-best-way-to-serialize-and-deserialize-a-python-object-to-and-from-json) and [How can I serialize a python object into JSON with python?](https://stackoverflow.com/questions/244009/how-can-i-serialize-a-python-object-into-json-with-python) offer solutions to specific use-cases, if you just want a dynamic serializer that can serialize arbitrary Python objects, you can use the built-in `json` module.

\begin{code}
import json

def serialize_to_json(obj, name):
    """Convert obj to a JSON string.  Optionally prefix the result with
    a key that is prepended to all serialized objects."""
    return json.dumps(obj, separators=(',', ':'))

def deserialize_from_json(data):
    """Convert a JSON string to a Python object.

    This function could be provided to the constructor of a dynamically
    serializable object, allowing for the creation of a dynamic serializer.
    """
    data = json.loads(data)
    return type(data, (obj,), {'name': data['name']})

