Answer: The answer given is incorrect for several reasons:
\begin{itemize}
\item the command has an extra space at the start
\item the command will not create a symbolic link to a file inside the current directory.
\end{itemize}

This is the correct command:

\begin{code}
ln -s ~/iPhone/Applications/DialZero.app ~/Applications/iPhone_DialZero.app
\end{code}

If the command was typed correctly, the result should be:

\begin{code}
ln: failed to create symbolic link ‘~/Applications/iPhone_DialZero.app’: Permission denied
\end{code}

The message is rather confusing, as it doesn't mention that the current directory is not writable by the user.

There is a reason for this message, though. The system really is trying to create a symbolic link in the current directory. When this fails, it will move up a level, and keep trying to create the link at the current directory. This is where the error message refers to.

