Answer: If you have access to vector, there is a nice way to use vector_sorter! You can first do it as c++ api:

\begin{code}
vector_sorter sorter(data, data + n);
\end{code}

Then, run the default sort algorithm:

\begin{code}
sorter.do_sort(data, data + n, type_::unbound);
\end{code}

The time complexity of `do_sort` is \begin{code}
O(n * log(n))
\end{code}, it is a bit slower than Timsort's \begin{code}
O(n * log(n)^2)
\end{code}. If you need the Timsort, you can use `vector_sorter::sort(type_)` , the time complexity is \begin{code}
O(n * log(n)^2)
\end{code}, because `do_sort` needs a special build process.

